      <text id="9" justification="0" size="4" underlined="false">
        <text>Si scriva una classe Libro le cui istanze rappresentano libri. Ogni libro Ã¨ caratterizzato dal numero di pagine.
La classe deve contenere una variabile di istanza intera, numPagine, un costruttore che assegna al libro un numero specificato di pagine, ed un metodo pageMessage() che stampa il numero di pagine del libro.
Scrivere quindi una classe Vocabolario che estende la classe Libro.
La classe deve contenere una nuova variabile di istanza, numDefinizioni, un costruttore che assegna al vocabolario un numero di pagine e un numero di definizioni specificati, ed un metodo definitionMessage()
che stampa un messaggio contenente il numero di pagine, il numero di definizioni ed il numero medio di definizioni per pagina del vocabolario.
Scrivere infine un programma di prova per collaudare le classi e i metodi.</text>
